			$time = $(get-date -UFormat %R)
			Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Running Change AD User script from Change Owner of AD groups tab, Groups ownership changed to $owner failed :: $CheckChangeOwnerOfADGroup"
			
