					}
					
					#-----------------------------------------
					# formatting email alias's
					#-----------------------------------------
					$alias = @()
					
					foreach ($proxy in $objecttype.proxyaddresses)
					{
						if ($proxy -notlike "x500*" -and $proxy -notlike "*@mgd.kiewit.com" -and $proxy -notlike "x400*")
						{
							$alias += $proxy
						}
					}
					
