					$richtextbox_AD_UsersLeft.appendText("Title:`n")
					$richtextbox_AD_UsersLeft.appendText("$divider `n")
					$richtextbox_AD_UsersLeft.appendText("Supervisor:`n")
					$richtextbox_AD_UsersLeft.appendText("Supervisor's Title:`n")
					$richtextbox_AD_UsersLeft.appendText("$divider `n")
