	$button_Top_Accounts_ADPC_Info_Click={
		#TODO: Place custom script here
		$groupbox_Bottom_ADPC_DeleteFilesOptions.visible = $false
		
		#-----------------------------
		# running search with cleaned up variables
		#-----------------------------
		$pcinfo = Get-ADcomputer $toolstrip_textbox_User_AD.Text -Properties * | Format-List name, canonicalname, enabled, operatingsystem, description, whenCreated, LastLogonDate | Out-String
		$osbuildinfo = Get-RegistryKey HKLM\SOFTWARE\OSBuildInfo\
		foreach ($keyvalue in $osbuildinfo)
		{
			$Obj = New-Object psobject
			$Obj | Add-Member -Name BootImageVersion -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_BootImageVersion")
			$Obj | Add-Member -Name DeploymentID -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_DeploymentID")
			$Obj | Add-Member -Name InstallationDate -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_InstallationDate")
			$Obj | Add-Member -Name InstallationMethod -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_InstallationMethod")
			$Obj | Add-Member -Name SiteCode -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_SiteCode")
			$Obj | Add-Member -Name StationID -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_StationID")
			$Obj | Add-Member -Name TattooScriptVersion -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_TattooScriptVersion")
			$Obj | Add-Member -Name Tech -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_Tech")
			$Obj | Add-Member -Name TSID -MemberType NoteProperty -Value $keyvalue.getvalue("PSDistrict_TSID")
		}
		$lapsinfo = get-lapspassword $toolstrip_textbox_User_AD.Text | Out-String
		
		$richtextbox_AD_PC.Clear()
		$richtextbox_AD_PC.Text = "$pcinfo`n"
		$richtextbox_AD_PC.AppendText("$($Obj | Out-String) `n")
		$richtextbox_AD_PC.AppendText($lapsinfo)
		
		#-----------------------------
		# writing to log file
		#-----------------------------
		$date = $(Get-Date).tostring("MM-dd-yyyy")
		$time = $(get-date -UFormat %R)
		Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Getting info for a PC from AD, Device searched: $($toolstrip_textbox_User_AD.Text)"
		
		Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Getting info for a PC from AD"
	}
	
