	$button_Top_Networking_DHCPSearch_Device_Click={
		#TODO: Place custom script here
		$richtextbox_Networking_Output.Visible = $false
		 
		
		$Error.clear()
		$info = $toolstriptextbox_Networking_Object.Text
		
		if ($info -like "*-*-*-*-*-*") {
			write-host "MAC address entered"
			$dhcp_lookup = Get-DhcpServerv4Scope -ComputerName KNEDCPIWP001 | foreach ($ScopeID) { Get-DhcpServerv4Lease -ComputerName KNEDCPIWP001 -ScopeId $_.ScopeID } | Where-Object { $_.ClientID -like "$info" }  | Select-Object IPAddress, ScopeID,AddressState,ClientID,HostName,LeaseExpiryTime,ServerIP	
		}
		elseif ($info -like "*.*") {
			write-host "IP address entered"
			$scope = $info.split(".")
			$scopeid = $scope[0] + "." + $scope[1] + "." + $scope[2] + ".0"
			Write-Host "scope ID : " $scopeid
			$dhcp_lookup = Get-DhcpServerv4Scope -ComputerName knedcpiwp001 -ScopeId $scopeid | Get-DhcpServerv4Lease -ComputerName knedcpiwp001 | Where-Object { $_.IPAddress -like "$info" } | Select-Object IPAddress, ScopeID, AddressState, ClientID, HostName, LeaseExpiryTime, ServerIP
			Write-Host "Name of scope : " $dhcp_scope.description
			Write-Host "dhcp lookup info : " $dhcp_lookup
		}
		else {
			try {
				$check = (get-adcomputer $info).name
				write-host "PC name found"
				$dhcp_lookup = Get-DhcpServerv4Scope -ComputerName KNEDCPIWP001 | foreach ($ScopeID) { Get-DhcpServerv4Lease -ComputerName KNEDCPIWP001 -ScopeId $_.ScopeId } | Where-Object { $_.HostName -like "$check.kiewitplaza.com" } | Select-Object IPAddress, ScopeID, AddressState, ClientID, HostName, LeaseExpiryTime, ServerIP
			}
			catch {
				write-host "no usable info found"
			}
		}
		
		$richtextbox_Networking_Output.Visible = $true
		if ($dhcp_lookup -ne $null)
		{
			#$richtextbox_Networking_Output.Text = $dhcp_lookup
			$dhcp_datatable = ConvertTo-DataTable -InputObject $dhcp_lookup
			Load-DataGridView -DataGridView $datagridview_NetworkOutput -Item $dhcp_datatable
			
		}
		else
		{
			$richtextbox_Networking_Output.Visible = $true
			$datagridview_NetworkOutput.Visible = $false
			 
			$richtextbox_Networking_Output.Text = $Error.Exception.Message | Out-String
			Write-Host "error occured : "  $Error.Exception.Message
		}
		#-----------------------------
		## writing to log file
		#-----------------------------
		$date = $(Get-Date).tostring("MM-dd-yyyy")
		$time = $(get-date -UFormat %R)
		Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Searching for device in DHCP"
		
		Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Searching for device in DHCP"
	}
	
