	$button_Top_Accounts_LazyWinAdmin_Check_Click={
		#TODO: Place custom script here
		$groupbox_Bottom_ADPC_DeleteFilesOptions.visible = $false
		
		if (Test-Connection $toolstrip_textbox_User_AD.Text -Count 1 -Quiet)
		{
			$PingStatus = "OK"
			
			# Test Permissions
			if (Test-Path "\\$($toolstrip_textbox_User_AD.Text)\c$")
			{
				$PermissionStatus = "OK"
				
				# Test PSRemoting
				if (Test-PSRemoting -computername $toolstrip_textbox_User_AD.Text)
				{
					$PSRemotingStatus = "OPEN"
				}
				else
				{
					$PSRemotingStatus = "CLOSED"
				}
				
				# Test RDP
				if (Test-Port -tcp 3389 -computername $toolstrip_textbox_User_AD.Text)
				{
					$RDPStatus = "OPEN"
				}
				else
				{
					$label_RDPStatus = "CLOSED"
				}
				
				# Get the OS
				$OSWin32_OS = Get-WmiObject -Query "SELECT * FROM Win32_OperatingSystem" -ComputerName $toolstrip_textbox_User_AD.Text
				$OSCaption = ($OSWin32_OS | Select-Object caption).Caption
				$OSVersion = $OSWin32_OS.Version
				#2003/xp+
				$OSOther = $OSWin32_OS.OtherTypeDescription
				$OSSP = $OSWin32_OS.CSDVersion
				#2008/win7+
				$OSArchi = $OSWin32_OS.OSArchitecture
				
				$OSFullCaption = "$OSCaption $OSOther $OSArchi $OSSP"
				if ($OSFullCaption -contains "64") { $OSFullCaption = "$OSCaption $OSOther x86 $OSSP" }
				
				$OSStatus = $OSFullCaption.Replace('  ', ' ')
				#$label_OSStatus.ForeColor = "blue"
				
				# Get the uptime
				#$label_UptimeStatus.Text = $(Get-Uptime -ComputerName $ComputerName);$label_UptimeStatus.ForeColor = "blue"
				$LBTime = $OSWin32_OS.ConvertToDateTime($OSWin32_OS.Lastbootuptime)
				[TimeSpan]$uptime = New-TimeSpan $LBTime $(get-date)
				$UptimeStatus = "$($uptime.days) Days $($uptime.hours) Hours $($uptime.minutes) Minutes $($uptime.seconds) Seconds"
				
				
			} #end if (Test-Path "\\$ComputerName\c$")#
			else
			{
				$PermissionStatus = "Failed to contact PC."
			}
		} #end if (Test-Connection $ComputerName -Count 1 -Quiet)
		else
		{
			$PingStatus = "Failed to contact PC."
		}
		
		if ($PingStatus -eq "OK")
		{
			$richtextbox_AD_PC.Text = "Ping status :  $PingStatus `n"
			$groupbox_Bottom_ADPC.AppendText("Permission status : $PermissionStatus `n")
			$groupbox_Bottom_ADPC.AppendText("RDP status : $RDPStatus `n")
			$groupbox_Bottom_ADPC.AppendText("PSRemoting status : $PSRemotingStatus `n")
			$groupbox_Bottom_ADPC.AppendText("OS : $OSStatus `n")
			$groupbox_Bottom_ADPC.AppendText("Uptime : $UptimeStatus")
		}
		else
		{
			$richtextbox_AD_PC.Text = "FAILED to contact remote PC. Please check name and try again."
		}
		
		#-----------------------------
		## writing to log file
		#-----------------------------
		$date = $(Get-Date).tostring("MM-dd-yyyy")
		$time = $(get-date -UFormat %R)
		Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Toggling to LazyWinAdmin ribbon and doing PC remote check"
		
		Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Toggling to LazyWinAdmin ribbon and doing PC remote check"
	}
	
	
