	$button_Bottom_ADPC_Start_Click={
		#TODO: Place custom script here
		$Error.clear()
		$groupbox_Bottom_ADPC_Robocopy.Visible = $true
		$groupbox_Bottom_ADPC.Visible = $false
		$datagridview_Bottom_Accounts_ADPC_Output.Visible = $false
		
		try
		{
			$eta = $null
			$subfolders = "/S"
			$LogAppend = "/LOG+:C:\users\$env:username\appdata\local\kss\robocopy.log"
			
			if ($checkbox_ETA.Checked -eq $true)
			{
				$eta = "/ETA"
			}
			
			if ($radiobutton_CopySingleFile.Checked -eq $true)
			{
				$file = $($textbox_Bottom_ADPC_File.Text).split("\")
				Start-Process powershell.exe "Robocopy '$($textbox_Bottom_ADPC_SourceFolder.Text)' '\\$($toolstrip_textbox_User_AD.Text)\C$\Temp' '$($file[$file.count-1])' $eta $LogAppend /TEE"
				$richtextbox_Bottom_ADPC_Log.Text = $(get-content "C:\users\$env:username\appdata\local\kss\robocopy.log" | Out-String)
			}
			else
			{
				Start-Process powershell.exe "Robocopy '$($textbox_Bottom_ADPC_SourceFolder.Text)' '\\$($toolstrip_textbox_User_AD.Text)\C$\Temp' '/S' $eta $LogAppend /TEE"
				$richtextbox_Bottom_ADPC_Log.Text = $(get-content "C:\users\$env:username\appdata\local\kss\robocopy.log" | Out-String)
			}
	
			#-----------------------------
			## writing to log file
			#-----------------------------
			$date = $(Get-Date).tostring("MM-dd-yyyy")
			$time = $(get-date -UFormat %R)
			Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Copying files to $($toolstrip_textbox_User_AD.Text) using Robocopy"
			
			Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Copying files to $($toolstrip_textbox_User_AD.Text) using Robocopy"
		}
		catch
		{
			$groupbox_Bottom_ADPC_Robocopy.Visible = $false
			$datagridview_Bottom_Accounts_ADPC_Output.Visible = $false
			$groupbox_Bottom_ADPC.Visible = $true
			$richtextbox_AD_PC.Text = $Error.Exception
			
			#-----------------------------
			## writing to log file
			#-----------------------------
			$date = $(Get-Date).tostring("MM-dd-yyyy")
			$time = $(get-date -UFormat %R)
			Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Failed to copy files to $($toolstrip_textbox_User_AD.Text) using Robocopy"
			
			Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Failed to copy files to $($toolstrip_textbox_User_AD.Text) using Robocopy"
		}
	}
	
