	$button_Bottom_Accounts_ADPC_DeleteFiles_Click={
		#TODO: Place custom script here
		$groupbox_Bottom_ADPC_DeleteFilesOptions.Visible = $false
		$richtextbox_AD_PC.Clear()
		
		if ($textbox_Bottom_Accounts_ADPC_DeleteFiles_NumDays2Keep.Text -ne $null){
			$days = $textbox_Bottom_Accounts_ADPC_DeleteFiles_NumDays2Keep.Text 
		} else {
			$days = 0
		}
		
		if ($checkbox_Bottom_Accounts_ADPC_DeleteFilesOptions_Engineering.Checked) {
			$richtextbox_AD_PC.Text = "Deleting data that is $days days older from Engineer data stores"
			sleep -Seconds 1
			Delete-PCCache -Computer $($toolstrip_textbox_User_AD.Text) -age $days -engineering
		} 
		
		if ($checkbox_Bottom_Accounts_ADPC_DeleteFilesOptions_OS.Checked) {
			$richtextbox_AD_PC.Text = "Deleting data that is $days days older from OS temp locations"
			sleep -Seconds 1
			$richtextbox_AD_PC.Text = Delete-PCCache -Computer $($toolstrip_textbox_User_AD.Text) -age $days -OS
		} 
		
		if ($checkbox_Bottom_Accounts_ADPC_DeleteFilesOptions_User.Checked){
			$richtextbox_AD_PC.Text = "Deleting data that is $days days older from user temp locations"
			sleep -Seconds 1
			$richtextbox_AD_PC.Text = Delete-PCCache -Computer $($toolstrip_textbox_User_AD.Text) -age $days -user
		} 
		
		if ($checkbox_Bottom_Accounts_ADPC_DeleteFilesOptions_CCMCache.Checked) {
			$richtextbox_AD_PC.Text = "Deleting data that is $days days older from CCM Cache"
			sleep -Seconds 1
			$richtextbox_AD_PC.Text = Delete-PCCache -Computer $($toolstrip_textbox_User_AD.Text) -age $days -ccmcache
		}
		
		$groupbox_Bottom_ADPC.AppendText("Clearing of data complete, performing check of HD usage.")
		sleep -Seconds 1
		
		$buttonPhysicalDrives.PerformClick()
		
		#-----------------------------
		## writing to log file
		#-----------------------------
		$date = $(Get-Date).tostring("MM-dd-yyyy")
		$time = $(get-date -UFormat %R)
		Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Deleting cached and temp data from remote PC: $($toolstrip_textbox_User_AD.Text)"
		
		Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Deleting cached and temp data from remote PC: $($toolstrip_textbox_User_AD.Text)"
	}
	
