	$button_Bottom_Shares_Sharepoint_Parse_Click={
		#TODO: Place custom script here
		$URL = $richtextbox_Bottom_Shares_Sharepoint_AccessDeniedURL.Text
		
		$url = ($url.split("?"))[1]
		$url = $url -replace "Source=", ""
		$url = $url -replace "%3A", ":"
		$url = $url -replace "%2F", "/"
		$url = $url -replace "%2E", "."
		
		$richtextbox_Bottom_Shares_Shares_Sharepoint.Text = $URL
		
		#-----------------------------
		## writing to log file
		#-----------------------------
		$date = $(Get-Date).tostring("MM-dd-yyyy")
		$time = $(get-date -UFormat %R)
		Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Parsing access denied sharepoint link"
		
		Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Parsing access denied sharepoint link"
	}
	
