	$buttonTracert_Click={
		#TODO: Place custom script here
		$datagridview_NetworkOutput.Visible = $true
		$richtextbox_Networking_Output.Visible = $false
		$traceroute = Test-NetConnection $toolstriptextbox_Networking_Object.Text -TraceRoute | Select -ExpandProperty TraceRoute | % { Resolve-DnsName $_ -type PTR -ErrorAction SilentlyContinue }
		
		$tracert = ConvertTo-DataTable -InputObject $traceroute
		Load-DataGridView -DataGridView $datagridview_NetworkOutput -Item $tracert
		
		#-----------------------------
		## writing to log file
		#-----------------------------
		$date = $(Get-Date).tostring("MM-dd-yyyy")
		$time = $(get-date -UFormat %R)
		Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Performing tracert to $($toolstriptextbox_Networking_Object.Text)"
		
		Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Performing tracert to $($toolstriptextbox_Networking_Object.Text)"
		
	}
	
