	$textbox_Account_DateExpires_MouseDoubleClick=[System.Windows.Forms.MouseEventHandler]{
	#Event Argument: $_ = [System.Windows.Forms.MouseEventArgs]
		#TODO: Place custom script here
		
		function Get-ADUserExpirationDate
		{
			[void][System.Reflection.Assembly]::LoadWithPartialName("System.Windows.Forms")
			[void][System.Reflection.Assembly]::LoadWithPartialName("System.Drawing")
			
			# Set the size of your form
			$Form = New-Object System.Windows.Forms.Form
			$Form.width = 300
			$Form.height = 200
			$Form.Text = "New Expiration Date"
			
			# Set the font of the text to be used within the form
			$Font = New-Object System.Drawing.Font("Times New Roman", 10)
			$Form.Font = $Font
			
			# Create a group that will contain your radio buttons
			$MyGroupBox = New-Object System.Windows.Forms.GroupBox
			$MyGroupBox.Location = '25,10'
			$MyGroupBox.size = '225,100'
			$MyGroupBox.text = ""
			
			# Create the collection of radio buttons
			$RadioButton1 = New-Object System.Windows.Forms.RadioButton
			$RadioButton1.Location = '10,20'
			$RadioButton1.size = '125,20'
			$RadioButton1.Checked = $true
			$RadioButton1.Text = "Extend 60 Days"
			
			$RadioButton2 = New-Object System.Windows.Forms.RadioButton
			$RadioButton2.Location = '10,45'
			$RadioButton2.size = '125,20'
			$RadioButton2.Checked = $false
			$RadioButton2.Text = "Extend 6 Months"
			
			$RadioButton3 = New-Object System.Windows.Forms.RadioButton
			$RadioButton3.Location = '10,70'
			$RadioButton3.size = '125,20'
			$RadioButton3.Checked = $false
			$RadioButton3.Text = "Extend 1 Year"
			
			# Add an OK button
			# Thanks to J.Vierra for simplifing the use of buttons in forms
			$OKButton = new-object System.Windows.Forms.Button
			$OKButton.Location = '50,125'
			$OKButton.Size = '60,24'
			$OKButton.Text = 'OK'
			$OKButton.DialogResult = [System.Windows.Forms.DialogResult]::OK
			
			#Add a cancel button
			$CancelButton = new-object System.Windows.Forms.Button
			$CancelButton.Location = '125,125'
			$CancelButton.Size = '60,24'
			$CancelButton.Text = "Cancel"
			$CancelButton.DialogResult = [System.Windows.Forms.DialogResult]::Cancel
			
			# Add all the Form controls on one line 
			$form.Controls.AddRange(@($MyGroupBox, $OKButton, $CancelButton))
			
			# Add all the GroupBox controls on one line
			$MyGroupBox.Controls.AddRange(@($Radiobutton1, $RadioButton2, $RadioButton3))
			
			# Assign the Accept and Cancel options in the form to the corresponding buttons
			$form.AcceptButton = $OKButton
			$form.CancelButton = $CancelButton
			
			# Activate the form
			$form.Add_Shown({ $form.Activate() })
			
			# Get the results from the button click
			$dialogResult = $form.ShowDialog()
			
			# If the OK button is selected
			if ($dialogResult -eq "OK")
			{
				
				# Check the current state of each radio button and respond accordingly
				if ($RadioButton1.Checked)
				{
					$textbox_Account_DateExpires.Text = (Get-Date).adddays(60)
				}
				elseif ($RadioButton2.Checked)
				{
					$textbox_Account_DateExpires.Text = (Get-Date).addmonths(6)
				}
				elseif ($RadioButton3.Checked = $true)
				{
					$textbox_Account_DateExpires.Text = (Get-Date).addyears(1)
				}
			}
		}
		
		# Call the function
		Get-ADUserExpirationDate
		
	}
	
