			$groups1 = $groups -replace "CN=" | Sort-Object | out-string
			$memberof = Get-ADuser $param -Properties memberof | Select-Object -ExpandProperty memberof | Get-ADGroup -Properties name, canonicalname, description | Select-Object name, canonicalname, description
			$memberof = $memberof | Sort-Object name
			$memberof1 = ConvertTo-DataTable -InputObject $memberof
			$memberof1.Columns[1].ColumnName = "AD Domain Services Folder"
			Load-DataGridView -DataGridView $datagridview_MemberOf_Output -Item $memberof1
			
			$textbox_ADUser_AddUserToGroup_ADGroup_text = $textbox_MemberOf_Group2Edit.Text
			$richtextbox_MemberOf_Output.Text = "Removed user from $textbox_ADUser_AddUserToGroup_ADGroup_text"
			
