	}
	
	$button_Validate_ADUserExists_Click= {
		#TODO: Place custom script here
		$richtextbox_ADUserText = $textbox_ADUser.Text
		
		$validateADUser = Get-ADObject -LDAPFilter:"(anr=$richtextbox_ADUserText)"
		if ($validateADUser.name -eq $richtextbox_ADUserText)
		{
			$textbox_ValidateUser.Text = "User does exist"
			
			#-----------------------------
			# writing to log file
			#-----------------------------
			$date = $(Get-Date).tostring("MM-dd-yyyy")
			$time = $(get-date -UFormat %R)
			Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Running Validate AD User script from NTFS update permissions app, $richtextbox_ADUserText does exist."
		}
		else
		{
			
			$textbox_ValidateUser.Text = "No account found"
	
			#-----------------------------
			# writing to log file
			#-----------------------------
			$date = $(Get-Date).tostring("MM-dd-yyyy")
			$time = $(get-date -UFormat %R)
			Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Running Validate AD User script from NTFS update permissions app, No account found :: $richtextbox_ADUserText was the value entered"
			
		}
		
		Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Running Validate AD User script from NTFS update permissions app"
	}
	
	$button_Add2ADGroup_Click={
		#TODO: Place custom script here
		$richtextbox_NTFSOutput.Visible = $true
		$Error.clear()
		
		if ($richtextbox_Ticket.Text -ne $null)
		{
			try
			{
				Add-ADGroupMember -Identity $richtextbox_ADGroup.text -Members $textbox_ADUser.text
				$richtextbox_ADUsertext = $textbox_ADUser.text
				$richtextbox_ADGrouptext = $richtextbox_ADGroup.text
				$richtextbox_NTFSOutput.Text = "$richtextbox_ADUsertext has been added to $richtextbox_ADGrouptext `n"
				
				do
				{
					$memberof = Get-ADUser $textbox_ADUser.text | Select-Object memberof
					If ($memberof -contains $richtextbox_ADGroup.text)
					{
						$richtextbox_NTFSOutput.AppendText("Checking addition of user to group..... `n")
						$richtextbox_NTFSOutput.Text = "Confirmed, $richtextbox_ADUsertext has been added to $richtextbox_ADGrouptext"
					}
					else
					{
						$richtextbox_NTFSOutput.Text = "Check failed, check again after a few minutes."
					}
				}
				while ($memberof.memberof -notcontains $richtextbox_ADGroup.text)
				
				#-----------------------------
				# writing to log file
				#-----------------------------
				$date = $(Get-Date).tostring("MM-dd-yyyy")
				$time = $(get-date -UFormat %R)
				$richtextbox_Tickettext = $richtextbox_Ticket.Text
				Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Adding user to AD group: $richtextbox_ADUsertext to $richtextbox_ADGrouptext, Ticket: $richtextbox_Tickettext"
				
			}
			catch
			{
				$richtextbox_NTFSOutput.Text = "The user could not be added to the requested group. An error occured. `n"
				$richtextbox_NTFSOutput.AppendText($error.Exception.Message)
				
				
				#-----------------------------
				# writing to log file
				#-----------------------------
				$richtextbox_Tickettext = $richtextbox_Ticket.Text
				$date = $(Get-Date).tostring("MM-dd-yyyy")
				$time = $(get-date -UFormat %R)
				Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Adding user to AD group failed, Ticket: $richtextbox_Tickettext"
				
			}
		}
		else
		{
			$richtextbox_NTFSOutput.Text = "Please enter a valid SNOW ticket"
		}
	
		#-----------------------------
		# writing to log file
		#-----------------------------
		$richtextbox_ADGroup_text = $richtextbox_ADGroup.Text
		$textbox_ADUser_text = $textbox_ADUser.Text
		
		$date = $(Get-Date).tostring("MM-dd-yyyy")
		$time = $(get-date -UFormat %R)
		Log-Write -LogPath $LogFile -LineValue "$date, $time, $userName, $pcname, Adding $textbox_ADUser_text to AD group: $richtextbox_ADGroup_text"
		
		Log-Write -LogPath $logusagefile -LineValue "$date, $time, $userName, $pcname, Adding user to AD group"
		
		$textbox_ADUser_text = $textbox_ADUser.Text
		$richtextbox_ADGroup_text = $richtextbox_ADGroup.Text
		$richtextbox_Ticket_text = $richtextbox_Ticket.Text
		log-write -logpath $logfile_ticket -linevalue "$date, $time, $userName, ticket: $richtextbox_Ticket_text, NTFS Permissions change, User: $textbox_ADUser_text Group: $richtextbox_ADGroup_text"
	}
	
	$button_Close_Click={
		#TODO: Place custom script here
		$NTFS_Permissions.close()
	}
	
