					Add-Content -Path $outFile -Value "[$i]" -Encoding $Encoding
					Foreach ($j in $($InputObject[$i].keys | Sort-Object))
					{
						if ($j -match "^Comment[\d]+")
						{
							Write-Verbose "$($MyInvocation.MyCommand.Name):: Writing comment: $j"
							Add-Content -Path $outFile -Value "$($InputObject[$i][$j])" -Encoding $Encoding
						}
						else
						{
							Write-Verbose "$($MyInvocation.MyCommand.Name):: Writing key: $j"
							Add-Content -Path $outFile -Value "$j=$($InputObject[$i][$j])" -Encoding $Encoding
						}
						
					}
					Add-Content -Path $outFile -Value "" -Encoding $Encoding
				}
			}
			Write-Verbose "$($MyInvocation.MyCommand.Name):: Finished Writing to file: $path"
			if ($PassThru) { Return $outFile }
		}
		
		End
		{ Write-Verbose "$($MyInvocation.MyCommand.Name):: Function ended" }
	}
	
	Function Set-IniContent
	{
	    <#
	    .Synopsis
	        Updates existing values or adds new key-value pairs to an INI file
	    .Description
	        Updates specified keys to new values in all sections or certain sections.
	        Used to add new or change existing values. To comment, uncomment or remove keys use the related functions instead.
	        The ini source can be specified by a file or piped in by the result of Get-IniContent.
	        The modified content is returned as a ordered dictionary hashtable and can be piped to a file with Out-IniFile.
	    .Notes
	        Author		: Sean Seymour <seanjseymour@gmail.com> based on work by Oliver Lipkau <oliver@lipkau.net>
			Source		: https://github.com/lipkau/PsIni
	                      http://gallery.technet.microsoft.com/scriptcenter/ea40c1ef-c856-434b-b8fb-ebd7a76e8d91
	        Version		: 1.0.0 - 2016/08/18 - SS - Initial release
	                    : 1.0.1 - 2016/12/29 - SS - Removed need for delimiters by making Sections a string array
	                                                and NameValuePairs a hashtable. Thanks Oliver!
	        #Requires -Version 2.0
	    .Inputs
	        System.String
	        System.Collections.IDictionary
	    .Outputs
	        System.Collections.Specialized.OrderedDictionary
	    .Example
	        $ini = Set-IniContent -FilePath "C:\myinifile.ini" -Sections 'Printers' -NameValuePairs @{'Name With Space' = 'Value1' ; 'AnotherName' = 'Value2'}
	        -----------
	        Description
	        Reads in the INI File c:\myinifile.ini, adds or updates the 'Name With Space' and 'AnotherName' keys in the [Printers] section to the values specified,
	        and saves the modified ini to $ini.
	    .Example
	        Set-IniContent -FilePath "C:\myinifile.ini" -Sections 'Terminals','Monitors' -NameValuePairs @{'Updated=FY17Q2'} | Out-IniFile "C:\myinifile.ini" -Force
	        -----------
	        Description
	        Reads in the INI File c:\myinifile.ini and adds or updates the 'Updated' key in the [Terminals] and [Monitors] sections to the value specified.
	        The ini is then piped to Out-IniFile to write the INI File to c:\myinifile.ini. If the file is already present it will be overwritten.
	    .Example
	        Get-IniContent "C:\myinifile.ini" | Set-IniContent -NameValuePairs @{'Headers' = 'True' ; 'Update' = 'False'} | Out-IniFile "C:\myinifile.ini" -Force
	        -----------
	        Description
	        Reads in the INI File c:\myinifile.ini using Get-IniContent, which is then piped to Set-IniContent to add or update the 'Headers'  and 'Update' keys in all sections
	        to the specified values. The ini is then piped to Out-IniFile to write the INI File to c:\myinifile.ini. If the file is already present it will be overwritten.
	    .Example
	        Get-IniContent "C:\myinifile.ini" | Set-IniContent -NameValuePairs @{'Updated'='FY17Q2'} -Sections '_' | Out-IniFile "C:\myinifile.ini" -Force
	        -----------
	        Description
	        Reads in the INI File c:\myinifile.ini using Get-IniContent, which is then piped to Set-IniContent to add or update the 'Updated' key that
	        is orphaned, i.e. not specifically in a section. The ini is then piped to Out-IniFile to write the INI File to c:\myinifile.ini.
	    .Link
	        Get-IniContent
	        Out-IniFile
	    #>
		
		[CmdletBinding(DefaultParameterSetName = "File")]
		[OutputType(
					[System.Collections.IDictionary]
					)]
		Param
		(
			# Specifies the path to the input file.
			[Parameter(Position = 0, Mandatory, ParameterSetName = "File")]
			[ValidateNotNullOrEmpty()]
			[String]$FilePath,
			# Specifies the Hashtable to be modified.
	
			# Enter a variable that contains the objects or type a command or expression that gets the objects.
	
			[Parameter(Mandatory, ValueFromPipeline, ParameterSetName = "Object")]
			[ValidateNotNullOrEmpty()]
			[System.Collections.IDictionary]$InputObject,
			# Hashtable of one or more key names and values to modify. Required.
	
			[Parameter(Mandatory, ParameterSetName = "File")]
			[Parameter(Mandatory, ParameterSetName = "Object")]
			[ValidateNotNullOrEmpty()]
			[HashTable]$NameValuePairs,
			# String array of one or more sections to limit the changes to, separated by a comma.
	
			# Surrounding section names with square brackets is not necessary but is supported.
	
			# Ini keys that do not have a defined section can be modified by specifying '_' (underscore) for the section.
	
			[Parameter(ParameterSetName = "File")]
			[Parameter(ParameterSetName = "Object")]
			[ValidateNotNullOrEmpty()]
			[String[]]$Sections
		)
		
		Begin
		{
			Write-Debug "PsBoundParameters:"
			$PSBoundParameters.GetEnumerator() | ForEach-Object { Write-Debug $_ }
			if ($PSBoundParameters['Debug'])
			{
				$DebugPreference = 'Continue'
			}
			Write-Debug "DebugPreference: $DebugPreference"
			Write-Verbose "$($MyInvocation.MyCommand.Name):: Function started"
			
			# Update or add the name/value pairs to the section.
			Function Update-IniEntry
			{
				param ($content,
					$section)
				
				foreach ($pair in $NameValuePairs.GetEnumerator())
				{
					if (!($content[$section]))
					{
						Write-Verbose ("$($MyInvocation.MyCommand.Name):: '{0}' section does not exist, creating it." -f $section)
						$content[$section] = New-Object System.Collections.Specialized.OrderedDictionary([System.StringComparer]::OrdinalIgnoreCase)
					}
					
					Write-Verbose ("$($MyInvocation.MyCommand.Name):: Setting '{0}' key in section {1} to '{2}'." -f $pair.key, $section, $pair.value)
					$content[$section][$pair.key] = $pair.value
				}
			}
		}
		# Update the specified keys in the list, either in the specified section or in all sections.
		Process
		{
			# Get the ini from either a file or object passed in.
			if ($PSCmdlet.ParameterSetName -eq 'File') { $content = Get-IniContent $FilePath }
			if ($PSCmdlet.ParameterSetName -eq 'Object') { $content = $InputObject }
			
			# Specific section(s) were requested.
			if ($Sections)
			{
				foreach ($section in $Sections)
				{
					# Get rid of whitespace and section brackets.
					$section = $section.Trim() -replace '[][]', ''
					
					Write-Debug ("Processing '{0}' section." -f $section)
					
					Update-IniEntry $content $section
				}
			}
			else
			{
				# No section supplied, go through the entire ini since changes apply to all sections.
				foreach ($item in $content.GetEnumerator())
				{
					$section = $item.key
					
					Write-Debug ("Processing '{0}' section." -f $section)
					
					Update-IniEntry $content $section
				}
			}
			Write-Output $content
		}
		End
		{
			Write-Verbose "$($MyInvocation.MyCommand.Name):: Function ended"
		}
	}
	
	function get-password
	{
		param (
			[string]$word
		)
		
		Begin { }
		Process
		{
			
			if ($word.length -lt $passwordvariables.MinChar.Length)
			{
				
				$word = $word.substring(0, $passwordvariables.Complexity.Capital).toupper() + $word.substring($passwordvariables.Complexity.Capital).tolower()
				
				$wordlength = $passwordvariables.MinChar.Length - $word.Length
				
				if ($wordLength -eq "1")
				{
					$number = Get-Random -Minimum 0 -Maximum 9
				}
				elseif ($wordLength -eq "2")
				{
					$number = Get-Random -Minimum 10 -Maximum 99
				}
				elseif ($wordLength -eq "3")
				{
					$number = Get-Random -Minimum 100 -Maximum 999
				}
				elseif ($wordLength -eq "4")
				{
					$number = Get-Random -Minimum 1000 -Maximum 9999
				}
				elseif ($wordLength -eq "5")
				{
					$number = Get-Random -Minimum 10000 -Maximum 99999
				}
				elseif ($wordLength -eq "6")
				{
					$number = Get-Random -Minimum 100000 -Maximum 999999
				}
				elseif ($wordLength -eq "7")
				{
					$number = Get-Random -Minimum 1000000 -Maximum 9999999
				}
				
				$password = $word + $number
				
			}
			else
			{
				
				$word1 = $word.substring(0, $passwordvariables.Complexity.Capital).toupper() + $word.substring($passwordvariables.Complexity.Capital).tolower()
				
				$leet = @{ a = '@'; e = 3; i = '!'; l = 1; o = 0 }
				$rand = new-object System.Random
				$number = $null
				
				if ($args[0]) { $word = $args[0] }
				$leet.Keys | foreach-object { $skip = $rand.Next(0, 3); if ($skip -ne 0) { $word = $word.Replace($_, $leet[$_]) } }
				
				$word2 = $word1.Substring(0, $passwordvariables.Word.Min_NonChanged_Char)
				$lastword = $word.Substring($passwordvariables.Word.Min_NonChanged_Char, $word.length - $passwordvariables.Word.Min_NonChanged_Char)
				$word3 = $word2 + $lastword
				
				if ($word3 -match "[0-9]")
				{
					$password = $word3
				}
				else
				{
					$number = Get-Random -Minimum 0 -Maximum 9
					$password = $word3 + $number
				}
				
			}
			
			
		}
		End
		{
			$password = $password + $special_character
			Write-Output $password
		}
	}
	
	function get-passphrase
	{
		param (
			
		)
		begin { }
		process
		{
			do {
				$Password = ($UncommonWords | Get-Random)
			} until ($Password.length -le 6)
			$Password = $Password.substring(0, $passwordvariables.Complexity.Capital).toupper() + $Password.substring($passwordvariables.Complexity.Capital).tolower()
			
			do{
				$Password1 = ($UncommonWords | Get-Random)
			} until ($Password1.length -le 6)
			$Password1 = $Password1.substring(0, $passwordvariables.Complexity.Capital).toupper() + $Password1.substring($passwordvariables.Complexity.Capital).tolower()
			
			#$Password2 = ($UncommonWords | Get-Random)
			#$Password2 = $Password2.substring(0, $passwordvariables.Complexity.Capital).toupper() + $Password2.substring($passwordvariables.Complexity.Capital).tolower()
			
			$Password = $Password + $Password1 #+ $Password2
			
			If ($Password.length -lt $passwordvariables.MinChar.PassPhrase)
			{
				do
				{
					do{
						$Password3 = ($UncommonWords | Get-Random)
					}until ($Password3.length -le 6)
					$Password3 = $Password3.substring(0, $passwordvariables.Complexity.Capital).toupper() + $Password3.substring($passwordvariables.Complexity.Capital).tolower()
					$Password = $Password + $Password3
				}
				while ($Password.length -lt $passwordvariables.MinChar.PassPhrase)
			}
			$Password = $Password + $(get-random -Maximum 2099) + $(get-random $special_characters)
			Write-Output $Password
		}
		end { }
	}
	
	function Get-IP
	{
		
	    <#
	        .Synopsis 
	            Get the IP of the specified host.
	            
	        .Description
	            Get the IP of the specified host.
	            
	        .Parameter ComputerName
	            Name of the Computer to get IP (Default localhost.)
	                
	        .Example
	            Get-IP
	            Description
	            -----------
	            Get IP information the localhost
	            
	            
	        .OUTPUTS
	            PSCustomObject
	            
	        .INPUTS
	            System.String
	        
	        .Notes
	            NAME:      Get-IP
	            AUTHOR:    YetiCentral\bshell
	            Website:   www.bsonposh.com
	            #Requires -Version 2.0
	    #>
		
		[Cmdletbinding()]
		Param (
			[alias('dnsHostName')]
			[Parameter(ValueFromPipelineByPropertyName = $true, ValueFromPipeline = $true)]
			[string]$ComputerName = $Env:COMPUTERNAME
		)
		Process
		{
			$NICs = Get-WmiObject Win32_NetworkAdapterConfiguration -Filter "IPEnabled='$True'" -ComputerName $ComputerName
			foreach ($Nic in $NICs)
			{
				$myobj = @{
					Name		   = $Nic.Description
					MacAddress	   = $Nic.MACAddress
					IP4		       = $Nic.IPAddress | where{ $_ -match "\d+\.\d+\.\d+\.\d+" }
					IP6		       = $Nic.IPAddress | where{ $_ -match "\:\:" }
					IP4Subnet	   = $Nic.IPSubnet | where{ $_ -match "\d+\.\d+\.\d+\.\d+" }
					DefaultGWY	   = $Nic.DefaultIPGateway | Select -First 1
					DNSServer	   = $Nic.DNSServerSearchOrder
					WINSPrimary    = $Nic.WINSPrimaryServer
					WINSSecondary  = $Nic.WINSSecondaryServer
				}
				$obj = New-Object PSObject -Property $myobj
				$obj.PSTypeNames.Clear()
				$obj.PSTypeNames.Add('BSonPosh.IPInfo')
				$obj
			}
		}
	}
	
	function Get-Routetable
	{
		
	    <#
	        .Synopsis 
	            Gets the route table for specified host.
	            
	        .Description
	            Gets the route table for specified host.
	            
	        .Parameter ComputerName
	            Name of the Computer to get the route table from (Default is localhost.)
	            
	        .Example
	            Get-RouteTable
	            Description
	            -----------
	            Gets route table from local machine
	    
	        .Example
	            Get-RouteTable -ComputerName MyServer
	            Description
	            -----------
	            Gets route table from MyServer
	            
	        .Example
	            $Servers | Get-RouteTable
	            Description
	            -----------
	            Gets route table for each machine in the pipeline
	            
	        .OUTPUTS
	            PSCustomObject
	            
	        .INPUTS
	            System.String
	            
	        .Link
	            N/A
	            
	        .Notes
	            NAME:      Get-RouteTable
	            AUTHOR:    bsonposh
	            Website:   http://www.bsonposh.com
	            Version:   1
	            #Requires -Version 2.0
	    #>
		
		[Cmdletbinding()]
		Param (
			[alias('dnsHostName')]
			[Parameter(ValueFromPipelineByPropertyName = $true, ValueFromPipeline = $true)]
			[string]$ComputerName = $Env:COMPUTERNAME
		)
		process
		{
			
			if ($ComputerName -match "(.*)(\$)$")
			{
				$ComputerName = $ComputerName -replace "(.*)(\$)$", '$1'
			}
			try
			{
				$Routes = Get-WMIObject Win32_IP4RouteTable -ComputerName $ComputerName -Property Name, Mask, NextHop, Metric1, Type
				foreach ($Route in $Routes)
				{
					$myobj = @{ }
					$myobj.ComputerName = $ComputerName
					$myobj.Name = $Route.Name
					$myobj.NetworkMask = $Route.mask
					$myobj.Gateway = if ($Route.NextHop -eq "0.0.0.0") { "On-Link" }
					else { $Route.NextHop }
					$myobj.Metric = $Route.Metric1
					
					$obj = New-Object PSObject -Property $myobj
					$obj.PSTypeNames.Clear()
					$obj.PSTypeNames.Add('BSonPosh.RouteTable')
					$obj
				}
			}
			catch
			{
				Write-Host " Host [$ComputerName] Failed Connectivity Test " -ForegroundColor Red
			}
			
		}
	}
	
	
	function Test-Server
	{
		[cmdletBinding()]
		param (
			[parameter(Mandatory = $true, ValueFromPipeline = $true)]
			[string[]]$ComputerName,
			[parameter(Mandatory = $false)]
			[switch]$CredSSP,
			[Management.Automation.PSCredential]$Credential)
		
		begin
		{
			$total = Get-Date
			$results = @()
			if ($credssp) { if (!($credential)) { Write-Host "must supply Credentials with CredSSP test"; break } }
		}
		process
		{
			foreach ($name in $computername)
			{
				$dt = $cdt = Get-Date
				Write-verbose "Testing: $Name"
				$failed = 0
				try
				{
					$DNSEntity = [Net.Dns]::GetHostEntry($name)
					$domain = ($DNSEntity.hostname).replace("$name.", "")
					$ips = $DNSEntity.AddressList | %{ $_.IPAddressToString }
				}
				catch
				{
					$rst = "" | select Name, IP, Domain, Ping, WSMAN, CredSSP, RemoteReg, RPC, RDP
					$rst.name = $name
					$results += $rst
					$failed = 1
				}
				Write-verbose "DNS:  $((New-TimeSpan $dt ($dt = get-date)).totalseconds)"
				if ($failed -eq 0)
				{
					foreach ($ip in $ips)
					{
						
						$rst = "" | select Name, IP, Domain, Ping, WSMAN, CredSSP, RemoteReg, RPC, RDP
						$rst.name = $name
						$rst.ip = $ip
						$rst.domain = $domain
						####RDP Check (firewall may block rest so do before ping
						try
						{
							$socket = New-Object Net.Sockets.TcpClient($name, 3389)
							if ($socket -eq $null)
							{
								$rst.RDP = $false
							}
							else
							{
								$rst.RDP = $true
								$socket.close()
							}
						}
						catch
						{
							$rst.RDP = $false
						}
						Write-verbose "RDP:  $((New-TimeSpan $dt ($dt = get-date)).totalseconds)"
						#########ping
						if (test-connection $ip -count 1 -Quiet)
						{
							Write-verbose "PING:  $((New-TimeSpan $dt ($dt = get-date)).totalseconds)"
							$rst.ping = $true
							try
							{
								############wsman
								Test-WSMan $ip | Out-Null
								$rst.WSMAN = $true
							}
							catch
							{ $rst.WSMAN = $false }
							Write-verbose "WSMAN:  $((New-TimeSpan $dt ($dt = get-date)).totalseconds)"
							if ($rst.WSMAN -and $credssp) ########### credssp
							{
								try
								{
									Test-WSMan $ip -Authentication Credssp -Credential $cred
									$rst.CredSSP = $true
								}
								catch
								{ $rst.CredSSP = $false }
								Write-verbose "CredSSP:  $((New-TimeSpan $dt ($dt = get-date)).totalseconds)"
							}
							try ########remote reg
							{
								[Microsoft.Win32.RegistryKey]::OpenRemoteBaseKey([Microsoft.Win32.RegistryHive]::LocalMachine, $ip) | Out-Null
								$rst.remotereg = $true
							}
							catch
							{ $rst.remotereg = $false }
							Write-verbose "remote reg:  $((New-TimeSpan $dt ($dt = get-date)).totalseconds)"
							try ######### wmi
							{
								$w = [wmi] ''
								$w.psbase.options.timeout = 15000000
								$w.path = "\\$Name\root\cimv2:Win32_ComputerSystem.Name='$Name'"
								$w | select none | Out-Null
								$rst.RPC = $true
							}
							catch
							{ $rst.rpc = $false }
							Write-verbose "WMI:  $((New-TimeSpan $dt ($dt = get-date)).totalseconds)"
						}
						else
						{
							$rst.ping = $false
							$rst.wsman = $false
							$rst.credssp = $false
							$rst.remotereg = $false
							$rst.rpc = $false
						}
						$results += $rst
					}
				}
				Write-Verbose "Time for $($Name): $((New-TimeSpan $cdt ($dt)).totalseconds)"
				Write-Verbose "----------------------------"
			}
		}
		end
		{
			Write-Verbose "Time for all: $((New-TimeSpan $total ($dt)).totalseconds)"
			Write-Verbose "----------------------------"
			return $results
		}
	}
	
	function Get-NICInfo
	{
		
	    <#
	        .Synopsis  
	            Gets the NIC info for specified host
	            
	        .Description
	            Gets the NIC info for specified host
	            
	        .Parameter ComputerName
	            Name of the Computer to get the NIC info from (Default is localhost.)
	            
	        .Example
	            Get-NicInfo
	            # Gets NIC info from local machine
	    
	        .Example
	            Get-NicInfo -ComputerName MyServer
	            Description
	            -----------
	            Gets NIC info from MyServer
	            
	        .Example
	            $Servers | Get-NicInfo
	            Description
	            -----------
	            Gets NIC info for each machine in the pipeline
	            
	        .OUTPUTS
	            PSCustomObject
	            
	        .Notes
	            NAME:      Get-NicInfo 
	            AUTHOR:    YetiCentral\bshell
	            Website:   www.bsonposh.com
	            #Requires -Version 2.0
	    #>
		
		[Cmdletbinding()]
		Param (
			[alias('dnsHostName')]
			[Parameter(ValueFromPipelineByPropertyName = $true, ValueFromPipeline = $true)]
			[string]$ComputerName # = $Env:COMPUTERNAME
		)
		
		Process
		{
			if ($ComputerName -match "(.*)(\$)$")
			{
				$ComputerName = $ComputerName -replace "(.*)(\$)$", '$1'
			}
	
			$NICS = Get-WmiObject -class Win32_NetworkAdapterConfiguration -ComputerName $ComputerName
			
			foreach ($NIC in $NICS)
			{
				$Query = "Select Name,NetConnectionID FROM Win32_NetworkAdapter WHERE Index='$($NIC.Index)'"
				$NetConnnectionID = Get-WmiObject -Query $Query -ComputerName $ComputerName
				
				$myobj = @{
					ComputerName  = $ComputerName
					Name		  = $NetConnnectionID.Name
					NetID		  = $NetConnnectionID.NetConnectionID
					MacAddress    = $NIC.MacAddress
					IP		      = $NIC.IPAddress | ?{ $_ -match "\d*\.\d*\.\d*\." }
					Subnet	      = $NIC.IPSubnet | ?{ $_ -match "\d*\.\d*\.\d*\." }
					Enabled	      = $NIC.IPEnabled
					Index		  = $NIC.Index
				}
				
				$obj = New-Object PSObject -Property $myobj
				$obj.PSTypeNames.Clear()
				$obj.PSTypeNames.Add('BSonPosh.NICInfo')
				$obj
			}
	
		}
	}
	
	function search-AD
