			[string]$ADObject
		)
		
		begin
		{
		}
		
		Process
		{
			if (Is-Numeric $ADObject)
			{
				if ($ADObject.length -gt "6")
				{ $ADObject = $ADObject.TrimStart("0") }
				$object = Get-ADUser -filter { (employeeid -like $ADObject) -and (name -notlike "*admin") } -Properties *
