								Vendor = $SubKey.GetValue("Publisher")
								InstallDate = $InstallDate
						}
						$obj = New-Object PSObject -Property $myobj
							$obj.PSTypeNames.Clear()
							$obj.PSTypeNames.Add('BSonPosh.SoftwareInfo')
							$obj
						}
					}
				}
