	function Delete-PCCache
	{
		param (
			[String]$computer = "A-G0Q67Y1",
			#provide a computer name to clean remote computers
	
			[String]$age,
			[parameter(Mandatory = $false)]
			[Switch]$Engineering,
			[parameter(Mandatory = $false)]
			[Switch]$OS,
			[parameter(Mandatory = $false)]
			[Switch]$User,
			[parameter(Mandatory = $false)]
			[Switch]$CCMCache
		)
		
		begin
		{
			$root = $computer = "\\" + $computer + "\c$"
			$agelimit = (Get-Date).AddDays(- $days)
			
			# Establish list of locations where all files and subfolders older than the age limit be deleted
			$folders = @()
