			{
				$folders += $root + '\Autodesk'
				$folders += $root + '\BentleyDownloads'
				$folders += $root + '\SmartPlantReviewData'
				write-host "Engineering switch chosen. Updating function."
			}
			
			if ($OS)
			{
				$folders += $root + '\Dell'
				$folders += $root + '\Intel'
				$folders += $root + '\Windows\Temp'
				$folders += $root + '\Users\Default\AppData\Local\Temp'
				write-host "OS switch chosen. Updating function."
			}
			
			if ($User)
			{
				write-host "User switch chosen. Updating function."
				$folders += $root + '\Temp'
				$profiles = Get-ChildItem "$root\Users" -directory
				foreach ($profile in $profiles) { $folders += $root + '\Users\' + $profile.Name + '\AppData\Local\Temp' }
			}
			
			if ($CCMCache)
			{
				write-host "CCMCache switch chosen. Updating function."
				$folders += $root + '\Windows\ccmcache'
			}
		}
		
		process
		{
			
			try
			{
				# Delete old temp files from the listed root folders
				foreach ($folder in $folders)
				{
					If (Test-Path $folder)
					{
						#Only run this block if the folder exists
						# Delete files older than the $limit.
						write-host $folder "has content. Deleting....."
						Get-ChildItem -Path $folder -Recurse -Force -Verbose | Where-Object { !$_.PSIsContainer -and $_.CreationTime -lt $agelimit }
						Get-ChildItem -Path $folder -Recurse -Force -Verbose | Where-Object { !$_.PSIsContainer -and $_.CreationTime -lt $agelimit } | Remove-Item -Force
						
						# Delete any empty directories left behind after deleting the old files.
						write-host $folder ": Finding empty folders and deleting....."
						Get-ChildItem -Path $folder -Recurse -Force -Verbose | Where-Object { $_.PSIsContainer -and (Get-ChildItem -Path $_.FullName -Recurse -Force | Where-Object { !$_.PSIsContainer }) -eq $null }
						Get-ChildItem -Path $folder -Recurse -Force -Verbose | Where-Object { $_.PSIsContainer -and (Get-ChildItem -Path $_.FullName -Recurse -Force | Where-Object { !$_.PSIsContainer }) -eq $null } | Remove-Item -Force -Recurse
					}
				}
				
				# Establish list of file masks and their locations which need deleted:
				$file_masks = @{ }
				$file_masks.Add('*.MIG', $root + '\')
				
				
				# Delete the listed file masks
				foreach ($mask in $file_masks.GetEnumerator() | Sort Name)
				{
					If (Test-Path $mask.value)
					{
						#Only run this block if the folder exists
						Get-ChildItem -Path $mask.value -Filter $mask.key -Force -Verbose | Where-Object { !$_.PSIsContainer -and $_.CreationTime -lt $agelimit } #List affected files
						Get-ChildItem -Path $mask.value -Filter $mask.key -Force -Verbose | Where-Object { !$_.PSIsContainer -and $_.CreationTime -lt $agelimit } | Remove-Item -Force #Delete files
					}
				}
			}
			catch
			{
				write-host "well, that didn't workout right."
			}
		}
		
		End
		{
			
		}
	}
	
	function get-directreports
	{
		[CmdletBinding()]
		Param ([Parameter(Mandatory = $true)]
			[string]$user
		)
		
		Begin { }
		
		Process
		{
			try
			{
				$directreports = Get-ADUser -filter { samaccountname -like $user -or displayname -like $user -or mail -like $user -or employeeid -like $user } -Properties directreports -verbose | select-object -ExpandProperty directreports | get-aduser -Properties employeeid | select-object Name, employeeid
				if ($directreports.length -eq "0")
				{
					$directreports = "No Results found under this user."
				}
			}
			catch
			{
				$directreports = "Error encountered or no results found."
			}
		}
		
		End { Write-Output $directreports }
	}
	
}
