	#----------------------------------------------
	[System.Windows.Forms.Application]::EnableVisualStyles()
	$formMassRemoveADGroups = New-Object 'System.Windows.Forms.Form'
	$buttonGroupMemberCheck = New-Object 'System.Windows.Forms.Button'
	$labelGroups = New-Object 'System.Windows.Forms.Label'
	$button_RemoveUsersGroups = New-Object 'System.Windows.Forms.Button'
	$richtextbox_Groups2Remove = New-Object 'System.Windows.Forms.RichTextBox'
	$textbox_UserToEdit = New-Object 'System.Windows.Forms.TextBox'
	$label_UserToEdit = New-Object 'System.Windows.Forms.Label'
	$InitialFormWindowState = New-Object 'System.Windows.Forms.FormWindowState'
	#endregion Generated Form Objects

