		#TODO: Initialize Form Controls here
		
		$global:properties = Get-ADUser $param -Properties *
		
		$textbox_UserToEdit.Text = $properties.samaccountname
		
	}
	
	$button_RemoveUsersGroups_Click={
		#TODO: Place custom script here
		Remove-Item $bulkADGroup -Force
		
		$name = "Groups"
		$name | Out-File $bulkADGroup -Force
		$richtextbox_Groups2Remove.Text | Out-File $bulkADGroup -Append -Force
		
		$groups = Import-Csv $bulkADGroup
		foreach ($group in $groups.groups)
		{
			try
			{
				Remove-ADGroupMember -Identity $group -Members $textbox_UserToEdit.Text -Confirm:$false
			}
			catch
			{
				
			}
			
		}
		
		$memberof = Get-ADuser $textbox_UserToEdit.Text -Properties memberof | Select-Object -ExpandProperty memberof | Get-ADGroup -Properties name, canonicalname, description | Select-Object name, canonicalname, description
		$richtextbox_Groups2Remove.Text = $memberof
		
	}
	
	# --End User Generated Script--
