	#region Generated Events
	#----------------------------------------------
	
	$Form_StateCorrection_Load=
	{
		#Correct the initial state of the form to prevent the .Net maximized form issue
		$formMassRemoveADGroups.WindowState = $InitialFormWindowState
	}
	
	$Form_StoreValues_Closing=
	{
		#Store the control values
		$script:MassEditGroups4user_richtextbox_Groups2Remove = $richtextbox_Groups2Remove.Text
		$script:MassEditGroups4user_textbox_UserToEdit = $textbox_UserToEdit.Text
	}

	
	$Form_Cleanup_FormClosed=
	{
		#Remove all event handlers from the controls
		try
		{
			$button_RemoveUsersGroups.remove_Click($button_RemoveUsersGroups_Click)
			$formMassRemoveADGroups.remove_Load($formMassRemoveADGroups_Load)
			$formMassRemoveADGroups.remove_Load($Form_StateCorrection_Load)
			$formMassRemoveADGroups.remove_Closing($Form_StoreValues_Closing)
			$formMassRemoveADGroups.remove_FormClosed($Form_Cleanup_FormClosed)
		}
		catch { Out-Null <# Prevent PSScriptAnalyzer warning #> }
	}
	#endregion Generated Events

	#----------------------------------------------
	#region Generated Form Code
	#----------------------------------------------
	$formMassRemoveADGroups.SuspendLayout()
	#
